#include <iostream>
#include <vector>
#include <unordered_map>
#include "../util.h"

using namespace std;
class Solution {
public:
    int numSubarraysWithSum(vector<int>& nums, int goal) {
        const int32_t min_win = (goal != 0 ? goal:1);
        int32_t left = 0, right = 0;
        int32_t sum = 0;
        int32_t result = 0;

        for(left = 0; left + min_win <= nums.size(); ++left){
            sum = 0;
            for(right = left; right < nums.size(); ++right){
                sum += nums[right];
                if(sum == goal){
                    ++result;
                }else if(sum > goal){
                    break;
                }
            }
        }
        return result;
    }
};

namespace Optimial{
class Solution {
public:
    int numSubarraysWithSum(vector<int>& nums, int goal) {
        unordered_map<int32_t, int32_t> cnt_tab;
        int sum = 0;
        int32_t result = 0;

        for(const auto& num:nums){
            ++cnt_tab[sum];
            sum += num;
            //cout << (sum - goal) << " ===> " << cnt_tab[sum - goal] << endl;;
            result += cnt_tab[sum - goal];
        }
#if 0
        for(const auto& obj:cnt_tab){
           cout << "sum: " << obj.first << ",cnt: " << obj.second << endl;
        }
#endif

        return result;
    }
};
}
